import Pokemon from "../Img/Pokemon.png";
import "./Projects.css";
const Projects = () => {
  return (
    <div className="container">
      <div className="row bg-success  ">
        <div className="col-12 fs-1 text Projects">My Projects</div>
        <div className="row">
          <div className="col-2 mx-4 container-card">
            <img></img>
            <div className="row">Ricardo</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Projects;
